import React, { Component } from 'react'
import styled from 'styled-components'
import { FlexboxCenter } from '../StyledCom/flexbox.js'

const TestProps = (props) => {
    console.log(props);
    return(
        <div style={{
            height: "50px",
            width: "100%"
        }}>
        <span style={{
            color: "#000000"
        }}>
            {props.testValue}
        </span>
        </div>
    );
}

export default TestProps;
